import Match from "./Slotmactch";
import NotMatch from "./falsepar";
const SlotM=(props)=>{
    // let x='üòÑ';
    // let y='üòÑ';
    // let z='üéÖüèª';
    let x= props.x;
    let y= props.y;
    let z= props.z;
   {((x===y) && (y===z))? {Match}:{NotMatch}}
}
export default SlotM;
